import React from "react";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Main />} />
        <Route path="/about" element={<Page1 />} />
        <Route path="/portfolio" element={<Page2 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
